import React from "react";

const Template = () => (
  <div className="embed-responsive embed-responsive-16by9">
    <iframe
      id="youtube-vid"
      className="embed-responsive-item"
      src="https://www.youtube.com/embed/oskddwGpwUw?autoplay=1"
      allowFullScreen
    />
  </div>
);

export default Template;
